INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (1, 'The Shawshank Redemption', 'Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.', '142 min', 1994, 9.3);
