INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (933, 'Saw', 'Two strangers awaken in a room with no recollection of how they got there, and soon discover they''re pawns in a deadly game perpetrated by a notorious serial killer.', '103 min', 2004, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (934, 'Synecdoche, New York', 'A theatre director struggles with his work, and the women in his life, as he creates a life-size replica of New York City inside a warehouse as part of his new play.', '124 min', 2008, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (935, 'Mysterious Skin', 'A teenage hustler and a young man obsessed with alien abductions cross paths, together discovering a horrible, liberating truth.', '105 min', 2004, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (936, 'Jeux d''enfants', 'As adults, best friends Julien and Sophie continue the odd game they started as children -- a fearless competition to outdo one another with daring and outrageous stunts. While they often act out to relieve one another''s pain, their game might be a way to avoid the fact that they are truly meant for one another.', '93 min', 2003, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (937, 'Un long dimanche de fiançailles', 'Tells the story of a young woman''s relentless search for her fiancé, who has disappeared from the trenches of the Somme during World War One.', '133 min', 2004, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (938, 'The Station Agent', 'When his only friend dies, a man born with dwarfism moves to rural New Jersey to live a life of solitude, only to meet a chatty hot dog vendor and a woman dealing with her own personal loss.', '89 min', 2003, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (939, '21 Grams', 'A freak accident brings together a critically ill mathematician, a grieving mother, and a born-again ex-con.', '124 min', 2003, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (940, 'Boksuneun naui geot', 'A recently laid off factory worker kidnaps his former boss'' friend''s daughter, hoping to use the ransom money to pay for his sister''s kidney transplant.', '129 min', 2002, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (941, 'Finding Neverland', 'The story of Sir J.M. Barrie''s friendship with a family who inspired him to create Peter Pan.', '106 min', 2004, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (942, '25th Hour', 'Cornered by the DEA, convicted New York drug dealer Montgomery Brogan reevaluates his life in the 24 remaining hours before facing a seven-year jail term.', '135 min', 2002, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (943, 'The Butterfly Effect', 'Evan Treborn suffers blackouts during significant events of his life. As he grows up, he finds a way to remember these lost memories and a supernatural way to alter his life by reading his journal.', '113 min', 2004, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (944, '28 Days Later...', 'Four weeks after a mysterious, incurable virus spreads throughout the UK, a handful of survivors try to find sanctuary.', '113 min', 2002, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (945, 'Batoru rowaiaru', 'In the future, the Japanese government captures a class of ninth-grade students and forces them to kill each other under the revolutionary "Battle Royale" act.', '114 min', 2000, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (946, 'The Royal Tenenbaums', 'The eccentric members of a dysfunctional family reluctantly gather under the same roof for various reasons.', '110 min', 2001, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (947, 'Y tu mamá también', 'In Mexico, two teenage boys and an attractive older woman embark on a road trip and learn a thing or two about life, friendship, sex, and each other.', '106 min', 2001, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (948, 'Harry Potter and the Sorcerer''s Stone', 'An orphaned boy enrolls in a school of wizardry, where he learns the truth about himself, his family and the terrible evil that haunts the magical world.', '152 min', 2001, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (949, 'The Others', 'A woman who lives in her darkened old family house with her two photosensitive children becomes convinced that the home is haunted.', '101 min', 2001, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (950, 'Blow', 'The story of how George Jung, along with the Medellín Cartel headed by Pablo Escobar, established the American cocaine market in the 1970s in the United States.', '124 min', 2001, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (951, 'Enemy at the Gates', 'A Russian and a German sniper play a game of cat-and-mouse during the Battle of Stalingrad.', '131 min', 2001, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (952, 'Minority Report', 'In a future where a special police unit is able to arrest murderers before they commit their crimes, an officer from that unit is himself accused of a future murder.', '145 min', 2002, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (953, 'The Hurricane', 'The story of Rubin ''Hurricane'' Carter, a boxer wrongly imprisoned for murder, and the people who aided in his fight to prove his innocence.', '146 min', 1999, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (954, 'American Psycho', 'A wealthy New York City investment banking executive, Patrick Bateman, hides his alternate psychopathic ego from his co-workers and friends as he delves deeper into his violent, hedonistic fantasies.', '101 min', 2000, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (955, 'Lola rennt', 'After a botched money delivery, Lola has 20 minutes to come up with 100,000 Deutschmarks.', '81 min', 1998, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (956, 'The Thin Red Line', 'Adaptation of James Jones'' autobiographical 1962 novel, focusing on the conflict at Guadalcanal during the second World War.', '170 min', 1998, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (957, 'Mulan', 'To save her father from death in the army, a young maiden secretly goes in his place and becomes one of China''s greatest heroines in the process.', '88 min', 1998, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (958, 'Fear and Loathing in Las Vegas', 'An oddball journalist and his psychopathic lawyer travel to Las Vegas for a series of psychedelic escapades.', '118 min', 1998, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (959, 'Funny Games', 'Two violent young men take a mother, father, and son hostage in their vacation cabin and force them to play sadistic "games" with one another for their own amusement.', '108 min', 1997, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (960, 'Dark City', 'A man struggles with memories of his past, which include a wife he cannot remember and a nightmarish world no one else ever seems to wake up from.', '100 min', 1998, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (961, 'Sleepers', 'After a prank goes disastrously wrong, a group of boys are sent to a detention center where they are brutalized. Thirteen years later, an unexpected random encounter with a former guard gives them a chance for revenge.', '147 min', 1996, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (962, 'Lost Highway', 'Anonymous videotapes presage a musician''s murder conviction, and a gangster''s girlfriend leads a mechanic astray.', '134 min', 1997, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (963, 'Sense and Sensibility', 'Rich Mr. Dashwood dies, leaving his second wife and her three daughters poor by the rules of inheritance. The two eldest daughters are the title opposites.', '136 min', 1995, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (964, 'Die Hard: With a Vengeance', 'John McClane and a Harlem store owner are targeted by German terrorist Simon in New York City, where he plans to rob the Federal Reserve Building.', '128 min', 1995, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (965, 'Dead Man', 'On the run after murdering a man, accountant William Blake encounters a strange aboriginal American man named Nobody who prepares him for his journey into the spiritual world.', '121 min', 1995, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (966, 'The Bridges of Madison County', 'Photographer Robert Kincaid wanders into the life of housewife Francesca Johnson for four days in the 1960s.', '135 min', 1995, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (967, 'Apollo 13', 'NASA must devise a strategy to return Apollo 13 to Earth safely after the spacecraft undergoes massive internal damage putting the lives of the three astronauts on board in jeopardy.', '140 min', 1995, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (968, 'Trois couleurs: Blanc', 'After his wife divorces him, a Polish immigrant plots to get even with her.', '92 min', 1994, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (969, 'Falling Down', 'An ordinary man frustrated with the various flaws he sees in society begins to psychotically and violently lash out against them.', '113 min', 1993, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (970, 'Dazed and Confused', 'The adventures of high school and junior high students on the last day of school in May 1976.', '102 min', 1993, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (971, 'My Cousin Vinny', 'Two New Yorkers accused of murder in rural Alabama while on their way back to college call in the help of one of their cousins, a loudmouth lawyer with no trial experience.', '120 min', 1992, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (972, 'Omohide poro poro', 'A twenty-seven-year-old office worker travels to the countryside while reminiscing about her childhood in Tokyo.', '118 min', 1991, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (973, 'Delicatessen', 'Post-apocalyptic surrealist black comedy about the landlord of an apartment building who occasionally prepares a delicacy for his odd tenants.', '99 min', 1991, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (974, 'Home Alone', 'An eight-year-old troublemaker must protect his house from a pair of burglars when he is accidentally left home alone by his family during Christmas vacation.', '103 min', 1990, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (975, 'The Godfather: Part III', 'Follows Michael Corleone, now in his 60s, as he seeks to free his family from crime and find a suitable successor to his empire.', '162 min', 1990, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (976, 'When Harry Met Sally...', 'Harry and Sally have known each other for years, and are very good friends, but they fear sex would ruin the friendship.', '95 min', 1989, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (977, 'The Little Mermaid', 'A mermaid princess makes a Faustian bargain in an attempt to become human and win a prince''s love.', '83 min', 1989, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (978, 'The Naked Gun: From the Files of Police Squad!', 'Incompetent police Detective Frank Drebin must foil an attempt to assassinate Queen Elizabeth II.', '85 min', 1988, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (979, 'Planes, Trains & Automobiles', 'A man must struggle to travel home for Thanksgiving with a lovable oaf of a shower curtain ring salesman as his only companion.', '93 min', 1987, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (980, 'Lethal Weapon', 'Two newly paired cops who are complete opposites must put aside their differences in order to catch a gang of drug smugglers.', '109 min', 1987, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (981, 'Blood Simple', 'The owner of a seedy small-town Texas bar discovers that one of his employees is having an affair with his wife. A chaotic chain of misunderstandings, lies and mischief ensues after he devises a plot to have them murdered.', '99 min', 1984, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (982, 'On Golden Pond', 'Norman is a curmudgeon with an estranged relationship with his daughter Chelsea. At Golden Pond, he and his wife nevertheless agree to care for Billy, the son of Chelsea''s new boyfriend, and a most unexpected relationship blooms.', '109 min', 1981, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (983, 'Mad Max 2', 'In the post-apocalyptic Australian wasteland, a cynical drifter agrees to help a small, gasoline-rich community escape a horde of bandits.', '96 min', 1981, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (984, 'The Warriors', 'In the near future, a charismatic leader summons the street gangs of New York City in a bid to take it over. When he is killed, The Warriors are falsely blamed and now must fight their way home while every other gang is hunting them down.', '92 min', 1979, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (985, 'The Muppet Movie', 'Kermit and his newfound friends trek across America to find success in Hollywood, but a frog legs merchant is after Kermit.', '95 min', 1979, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (986, 'Escape from Alcatraz', 'Alcatraz is the most secure prison of its time. It is believed that no one can ever escape from it, until three daring men make a possible successful attempt at escaping from one of the most infamous prisons in the world.', '112 min', 1979, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (987, 'Watership Down', 'Hoping to escape destruction by human developers and save their community, a colony of rabbits, led by Hazel and Fiver, seek out a safe place to set up a new warren.', '91 min', 1978, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (988, 'Midnight Express', 'Billy Hayes, an American college student, is caught smuggling drugs out of Turkey and thrown into prison.', '121 min', 1978, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (989, 'Close Encounters of the Third Kind', 'Roy Neary, an electric lineman, watches how his quiet and ordinary daily life turns upside down after a close encounter with a UFO.', '138 min', 1977, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (990, 'The Long Goodbye', 'Private investigator Philip Marlowe helps a friend out of a jam, but in doing so gets implicated in his wife''s murder.', '112 min', 1973, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (991, 'Giù la testa', 'A low-life bandit and an I.R.A. explosives expert rebel against the government and become heroes of the Mexican Revolution.', '157 min', 1971, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (992, 'Kelly''s Heroes', 'A group of U.S. soldiers sneaks across enemy lines to get their hands on a secret stash of Nazi treasure.', '144 min', 1970, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (993, 'The Jungle Book', 'Bagheera the Panther and Baloo the Bear have a difficult time trying to convince a boy to leave the jungle for human civilization.', '78 min', 1967, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (994, 'Blowup', 'A fashion photographer unknowingly captures a death on film after following two lovers in a park.', '111 min', 1966, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (995, 'A Hard Day''s Night', 'Over two "typical" days in the life of The Beatles, the boys struggle to keep themselves and Sir Paul McCartney''s mischievous grandfather in check while preparing for a live television performance.', '87 min', 1964, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (996, 'Breakfast at Tiffany''s', 'A young New York socialite becomes interested in a young man who has moved into her apartment building, but her past threatens to get in the way.', '115 min', 1961, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (997, 'Giant', 'Sprawling epic covering the life of a Texas cattle rancher and his family and associates.', '201 min', 1956, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (998, 'From Here to Eternity', 'In Hawaii in 1941, a private is cruelly punished for not boxing on his unit''s team, while his captain''s wife and second-in-command are falling in love.', '118 min', 1953, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (999, 'Lifeboat', 'Several survivors of a torpedoed merchant ship in World War II find themselves in the same lifeboat with one of the crew members of the U-boat that sank their ship.', '97 min', 1944, 7.6);
INSERT INTO imdb.movies (id, title, overview, runtime, released_year, rating) VALUES (1000, 'The 39 Steps', 'A man in London tries to help a counter-espionage Agent. But when the Agent is killed, and the man stands accused, he must go on the run to save himself and stop a spy ring which is trying to steal top secret information.', '86 min', 1935, 7.6);
