create table movies
(
    id            int auto_increment
        primary key,
    title         varchar(200)  not null,
    overview      text          not null,
    runtime       varchar(20)   not null,
    released_year year          not null,
    rating        decimal(3, 1) not null
);


create table actors
(
    id   int auto_increment
        primary key,
    name varchar(50) not null
);


create table genres
(
    id    int auto_increment
        primary key,
    title varchar(20) not null
);


create table directors
(
    id   int auto_increment
        primary key,
    name varchar(50) not null
);


create table movies_actors
(
    id       int auto_increment
        primary key,
    movie_id int not null,
    actor_id int not null,
    constraint movies_actors_actor_id_fk
        foreign key (actor_id) references actors (id)
            on update cascade on delete cascade,
    constraint movies_actors_movie_id_fk
        foreign key (movie_id) references movies (id)
            on update cascade on delete cascade
);


create table movies_directors
(
    id          int auto_increment
        primary key,
    movie_id    int not null,
    director_id int not null,
    constraint movies_directors_director_id_fk
        foreign key (director_id) references directors (id)
            on update cascade on delete cascade,
    constraint movies_directors_movie_id_fk
        foreign key (movie_id) references movies (id)
            on update cascade on delete cascade
);


create table movies_genres
(
    id       int auto_increment
        primary key,
    movie_id int not null,
    genre_id int not null,
    constraint movies_genres_genre_id_fk
        foreign key (genre_id) references genres (id)
            on update cascade on delete cascade,
    constraint movies_genres_movie_id_fk
        foreign key (movie_id) references movies (id)
            on update cascade on delete cascade
);

